// Calculations.js

import React, { useState, useEffect } from "react";
import "./styles/styles.css";

const Calculations = () => {
  const [analysis, setAnalysis] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const fetchAnalysis = async () => {
    try {
      const response = await fetch("http://localhost:8000/analysis");
      if (!response.ok) {
        throw new Error("Failed to fetch analysis data");
      }
      const data = await response.json();
      setAnalysis(data);
      setLoading(false);
    } catch (error) {
      setError(error.message);
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchAnalysis();
  }, []);

  if (loading || !analysis) {
    return <p>Loading analysis information...</p>;
  }

  if (error) {
    return <p>Error fetching analysis data: {error}</p>;
  }

  return (
    <div className="analysis">
      <h2 className="header">Analysis Information</h2>
      <div className="details">
        <p>Net P&L: {analysis.net_pnl * 100}</p>
        <p>ROI: {analysis.roi}</p>
        <p>Win Count: {analysis.win_count}</p>
        <p>Loss Count: {analysis.loss_count}</p>
        <p>Win Rate: {analysis.win_rate}%</p>
      </div>
    </div>
  );
};

export default Calculations;
